import { defineStore } from 'pinia';

export const useCategory = defineStore({
  id: 'loggedInUser',
  state: () => ({ 
    categories: 'Anggara'
  }),
  actions: {
    setCategories(newCategories){
      console.log("Action setCategories dipanggil");
      this.categories(newCategories);
    },
  },
});
